[{"location":"functions/#Structs","page":"Functions","title":"Structs","text":"","category":"section"},{"location":"functions/","page":"Functions","title":"Functions","text":"Experiment{T}","category":"page"},{"location":"functions/#ElectroPhysiology.Experiment","page":"Functions","title":"ElectroPhysiology.Experiment","text":"Experiment{T}\n\nA mutable struct representing a physiological experiment.\n\nFields\n\nHeaderDict: A dictionary containing header information for the experiment.\ndt: A Real value representing the time step between data points.\nt: A vector containing the time points of the experiment.\ndata_array: A 3-dimensional array containing the experimental data.\nchNames: A vector of strings representing the names of the channels.\nchUnits: A vector of strings representing the units of the channels.\nchTelegraph: A vector of Real values representing the telegraph values of the channels.\nstimulus_protocol: A StimulusProtocol{T} object containing the stimulus protocol information.\n\nConstructors\n\nExperiment(data_array::AbstractArray; data_idx = 2): Create an Experiment object from an input data array with an optional data index.\nExperiment(time::Vector, data_array::Array{T, 3}) where T <: Real: Create an Experiment object from an input time vector and data array.\n\n\n\n\n\n","category":"type"},{"location":"functions/#Functions","page":"Functions","title":"Functions","text":"","category":"section"},{"location":"functions/","page":"Functions","title":"Functions","text":"pad(trace::Experiment{T}, n_add::Int64; position::Symbol=:post, val::T=0.0) where {T <: Real}","category":"page"},{"location":"functions/#ElectroPhysiology.pad-Union{Tuple{T}, Tuple{Experiment{T}, Int64}} where T<:Real","page":"Functions","title":"ElectroPhysiology.pad","text":"pad(trace::Experiment{T}, n_add::Int64; position::Symbol=:post, val::T=0.0) where {T <: Real}\npad!(trace::Experiment{T}, n_add::Int64; position::Symbol=:post, val::T=0.0) where {T <: Real}\n\nPad the data in a given Experiment object by adding elements with a specified value val either before or after the existing data.  This function returns a new Experiment object with the padded data. pad! is the inplace version, while pad creates a new experiment\n\nArguments\n\ntrace: An Experiment{T} object containing the experimental data.\nn_add: The number of elements to add.\nposition: (Optional) A symbol specifying where to add the elements. Can be :pre (before) or :post (after). Default is :post.\nval: (Optional) The value to use for padding. Default is 0.0.\n\nExample\n\nexp = Experiment(data_array)\npadded_exp = pad(exp, 100, position=:pre, val=0.0)\n\n\n\n\n\n","category":"method"},{"location":"functions/","page":"Functions","title":"Functions","text":"link to ElectroPhysiology.jl Documentation\nlink to Experiment{T}","category":"page"},{"location":"installation/#Installation","page":"Installation","title":"Installation","text":"","category":"section"},{"location":"installation/","page":"Installation","title":"Installation","text":"","category":"page"},{"location":"installation/","page":"Installation","title":"Installation","text":"using Pkg; Pkg.activate(\"Analysis\")\nPkg.add(\"ElectroPhysiology\")\nusing ElectroPhysiology","category":"page"},{"location":"#ElectroPhysiology.jl-Documentation","page":"Introduction","title":"ElectroPhysiology.jl Documentation","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"This module is for opening and modifying electrophysiology files","category":"page"},{"location":"tutorial/#Not-yet-working","page":"Tutorial","title":"Not yet working","text":"","category":"section"}]
